import React, { PureComponent } from 'react';
import "./right.css";
import EyeIcon from "../Image/eyeIcon.png";
export default class ExpertsManagement extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {  
		looks:[],
		}
    }

    render(){
		
		let look = this.state.looks;
		for(let i=0;i<99;i++){
			look.push(<img src={EyeIcon} alt=""/>);
		}
		this.setState({
			looks: look
		
        });
        return (
           <div className="memberList">{this.state.looks}</div>
        )
    }
}
